import "./styles/Bible-Study.css"

export default function BibleStudy() {
    return (
        <div>
            <Bodyfirst/>
        </div>
    )
}

const Bodyfirst = () => {
    return (
        <div>
            <h2>Word of the week</h2>
            <blockquote>
                "Don&apos;t let the enemy tell you what to do"
                <br/>Mark 12:13
            </blockquote>
        </div>
    )
}

const Bodysecond = () => {
    return (
        <div>
            <h2>Title</h2>

            <div className="body-first-discus">
                <div>
                    <p><em>Verse 10:</em></p>
                </div>

                <div>

                </div>

                <div>

                </div>

                <div>

                </div>
            </div>
        </div>
    )
}
